('16641INQPDII2022', '5bad9df0', '', '39caf30c', 'Fitraniasari', '62628561033532', 3, NULL, 'Fgd', 'Meeting', 40, '2022-02-03', '2022-02-03', '2022-02-05', '2022-02-05', NULL, 0, 'Dear Marketing Horison Ultima Bandung, \r\n\r\nPerkenalkan nama saya Fitraniasari (Fita) dari Ditjen Migas, Kementerian ESDM. Unit saya berencana untuk mengadakan konsinyering pada tanggal 3-5 Februari 2022 di Bandung, saat ini sedang mencari akomodasi hotel yang sesuai dengan permintaan kami. \r\n\r\nMohon dapat dibuatkan  quotation sesuai permintaan kami, jika memungkinkan sebagai berikut:\r\n(alternatif 1)\r\n3 Feb 2022: halfday meeting package, 20 pax\r\n4 Feb 2022: full board meeting package, 40 pax\r\n5 Feb 2022: halfday meeting package, 20 pax\r\ndengan 12 kamar\r\n\r\n(alternatif 1)\r\n3 Feb 2022: halfday meeting package, 20 pax\r\n4 Feb 2022: full day meeting package, 40 pax\r\n5 Feb 2022: halfday meeting package, 20 pax\r\ndengan 12 kamar\r\n\r\nuntuk koordinasi lebih lanjut, mohon dapat menghubungi saya di email ini ataupun WA ke 0856.1033532.\r\n\r\nlooking forward for your early reply. \r\n\r\nterima kasih.', '2022-01-12 20:08:08', NULL),
