('00035ec1', 'FULLBOARD MEETING RESIDENTIAL TWIN SHARING', 'fullboard-meeting-residential-twin-sharing', '<p>Room &amp; Breakfast for 2 (two) persons , 2X Coffee Break, 1X Lunch, 1X Dinner, Meeting Room and Standard Meeting Facilities Inclusive : Infocus, Screen, Mic, Sound, Candy, Note, Pencil, Wifi and Tax &amp; Service, 10 Hours usage Meeting Room</p>', 1080000, 0, '3', 1, NULL, '2022-08-30 09:47:00'),
('05cb6b3c', 'AKAD NIKAH PACKAGE', 'akad-nikah-package', 'Inclusive :\r\nFree venue akad and table decoration |\r\n1 Executive suite bridal room with decoration |\r\nFree make up room |\r\nGift voucher dinner couple |\r\nBuffet/bento meal for 50 pax |\r\nProtocol standard covid-19', 225000, 0, '3', 1, NULL, NULL),
('0a14a00c', 'SPA & MASSAGE', 'spa-massage', '<p>RELAX FROM HEAD TO TOE</p>\r\n\r\n<p>Starts from&nbsp;125.000 nett/pax</p>\r\n\r\n<p>at The Citrus Spa<br />\r\n9th Floor Horison Ultima Bandung</p>', 125000, 0, '4', 1, '2022-03-31 16:04:24', '2022-09-20 15:31:53'),
('0fb59279', 'SWIMMING POOL PACKAGE', 'swimming-pool-package', '1. Package 350.000 IDR/pax*\r\n    Visit 8 per month\r\n    Facilities Olimpic Pool, Children Pool, Wave Pool,\r\n    and Changing Room\r\n2. Package 450.000 IDR/pax*\r\n    For Individual and Corporate\r\n    Min. 10 person\r\n    Full visit 1 month\r\n    Facilities Olimpic Pool, Children Pool, Wave Pool,\r\n    Changing Room, Fitness, Sauna and Whirlpool', 350000, 0, '2', 1, NULL, NULL),
('28f9092c', 'Honeymoon Package', 'honeymoon-package', '<p>Inclusive :</p>\r\n\r\n<ul>\r\n	<li>Super Deluxe Room</li>\r\n	<li>Breakfast for 2 person (welcome drink)</li>\r\n	<li>Free Decoration (Flower &amp; Chocolate Praline)</li>\r\n	<li>Free Welcome Afternoon Tea</li>\r\n	<li>Dinner Couple</li>\r\n	<li>Free Access Wifi</li>\r\n</ul>', 1350000, 0, '4', 1, '2022-04-27 16:01:24', '2022-04-29 15:21:06'),
('2d9edf5d', 'Khitanan', 'khitanan', 'Inclusive :\r\nPrivate Venue |\r\nMinimum 50 pax/event |\r\nTechnical Meeting for 10 pax |\r\nFood Testing for 5 pax |\r\nSound System & Microphone |\r\nScreen & LCD Projector |\r\nHygiene & standard Protocol Covid-19', 180000, 0, '3', 1, NULL, NULL),
('3278449d', 'FULLBOARD MEETING RESIDENTIAL SINGLE OCCUPANCY', 'fullboard-meeting-residential-single-occupancy', '<p>Room and Breakfast for 1 (one) person, 2X Coffee Break, 1X Lunch, 1X Dinner, Meeting Room and Standard Meeting Facilities Inclusive : Infocus, Screen, Mic, Sound, Candy, Note, Pencil, Wifi and Include Tax &amp; Service, 10 Hours usage Meeting Room</p>', 1400000, 0, '3', 1, NULL, '2022-03-29 16:21:58'),
('332d4b36', 'Isoman Package', 'isoman-package', '<p>Inclusive : - Breakfast, lunch and dinner menu for 14 days - Free Delivery service max 2km - Minimum order 5 pax</p>', 95000, 0, '3', 0, NULL, '2022-08-30 09:46:04'),
('361fa4b1', 'RUBY PACKAGE', 'ruby-package', '<p>&bull; Venue at Parahyangan or Poolside<br />\r\n&bull; Police Permit<br />\r\n&bull; Wedding Menu:<br />\r\n- 2 (two) Appetizer Selections<br />\r\n- 1 (one) Soup<br />\r\n- 5 (five) Main Dishes Selection<br />\r\n&nbsp; (Steam Rice, Beef, Chicken, Vegetable, Noodle)<br />\r\n- 2 (two) Dessert Selections</p>\r\n\r\n<p>&bull; 1 (one) room wedding couple at Deluxe Room for 1 night<br />\r\n&bull; Free private venue for make up<br />\r\n&bull; Test food for 6 (six) person<br />\r\n&bull; Coffee Break Technical Meeting for 10 pax<br />\r\n&bull; Reception books<br />\r\n&bull; Box hantaran (seserahan)</p>\r\n\r\n<p>&bull; Wedding Decoration<br />\r\n- The altar (pelaminan) 7x3m<br />\r\n- Gazebo 3x3m<br />\r\n- Mini Garden<br />\r\n- Box Angpau 2pcs<br />\r\n- Set Akad<br />\r\n- Welcome Sign<br />\r\n- Standing Flower</p>\r\n\r\n<p>&bull; Entertainment Acoustic Band<br />\r\n- 1 Vocal (male / female)<br />\r\n- 1 Keyboard<br />\r\n- 1 Guitar<br />\r\n- Sound System</p>\r\n\r\n<p>&bull; Wedding Organizer<br />\r\n- 4 Crew WO<br />\r\n- Buku panduan pernikahan<br />\r\n- Technical meeting 1X</p>\r\n\r\n<p>&bull; MUA - Make up Artist<br />\r\n(Bridal make up &amp; 2 dress for Bridal)<br />\r\n- Make up Akad &amp; Resepsi<br />\r\n- Attire Akad &amp; Resepsi<br />\r\n- Parents Make Up<br />\r\n- Parents Attire<br />\r\n- Siger &amp; Melati<br />\r\n- Nail art, softlens, hairdo or hijabdo</p>\r\n\r\n<p>&bull; Master of Ceremony (MC) 1 person male<br />\r\n- MC Akad &amp; Resepsi<br />\r\n- Flashmoob / tiktok / games, etc</p>\r\n\r\n<p>&bull; Photography &amp; Videography<br />\r\n- 1 Album &amp; Box<br />\r\n- 1 Printed 16R + frame<br />\r\n- All file photo<br />\r\n- Full video cinematic<br />\r\n- Full video liputan akad &amp; resepsi<br />\r\n- 1 Fotographer<br />\r\n- 1 Videographer</p>', 100000, 1, '3', 1, NULL, '2022-08-30 10:06:15'),
('388bcf93', 'ADVENTURE EXPERIENCE PACKAGE', 'adventure-experience-package', '<p>Inclusive deluxe room, breakfast, lunch, coffee break, dinner, offroad, fun games and team building activity</p>', 100000, 1, '1', 1, NULL, NULL),
('39caf30c', 'DIAMOND PACKAGE', 'diamond-package', '<p>&bull; Venue at Krakatau Ballroom<br />\r\n&bull; Police Permit<br />\r\n&bull; Electricity (Genset) up to 50.000 kwh<br />\r\n&bull; Hygiene Standard Covid tools</p>\r\n\r\n<p>&bull; Wedding Menu:<br />\r\n- 2 (two) kind Appetizer Selections<br />\r\n- 1 (one) Soup<br />\r\n- 7 (seven) Main Dishes Selection<br />\r\n&nbsp; (Steam Rice, Beef, Chicken, Shrimp, Vegetable, Noodle, Side Dishes)<br />\r\n- 2 (two) kind Dessert Selections<br />\r\n- 6 (six) kind Stall<br />\r\n- 4 (four) kind of Beverages</p>\r\n\r\n<p>&bull; Complimentary 1 (one) room wedding couple at Executive Suite for 2 nights<br />\r\n&bull; Complimentary 2 (two) room at Executive Suite for parents for 2 nights<br />\r\n&bull; Flower Arrangement in Bridal Room &amp; Welcome Praline, Bridal Fruit &amp;<br />\r\n&nbsp; &nbsp;Fruit Champagne<br />\r\n&bull; Candle Light Dinner for Bridal couple<br />\r\n&bull; 10 (ten) Coffee Break for technical meeting<br />\r\n&bull; Free 2 private venue for make up<br />\r\n&bull; Test food 6(six) person<br />\r\n&bull; 15 box seserahan<br />\r\n- Choice of various themes for the gift box<br />\r\n- Arrangement for the elegant + seserahan box<br />\r\n&bull; 4 Reception books</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Wedding Decoration<br />\r\n- The altar (pelaminan) 10x3m<br />\r\n- Mini Garden<br />\r\n- Gazebo 4x4m<br />\r\n- Standing Flower<br />\r\n- Coridor Area Reception Guest<br />\r\n- Backdrop VIP<br />\r\n- Backdrop Music<br />\r\n- Backdrop Photobooth<br />\r\n- Set Akad<br />\r\n- Welcome Sign</p>\r\n\r\n<p>&bull; Entertainment Acoustic Band<br />\r\n- 2 Singer (male &amp; female)<br />\r\n- 1 Keyboard<br />\r\n- 1 Guitar / Saxo<br />\r\n- 1 Bass<br />\r\n- 1 Drum Electric<br />\r\n- Sound System 5000 watt<br />\r\n&nbsp;</p>\r\n\r\n<p>&bull; Wedding Planner + Wedding<br />\r\n&nbsp; &nbsp;Organizer (10 person)<br />\r\n- Decoration Concept Planning<br />\r\n- Managing letter of KUA<br />\r\n- Food