('46e1663c', 'ZAMRUD PACKAGE', 'zamrud-package', '<p>&bull; Venue at Parahyangan/ Poolside/ Krakatau Ballroom<br />\r\n&bull; Police Permit<br />\r\n&bull; Electricity (Genset) up to 50.000 kwh<br />\r\n&bull; Hygiene Standard Covid tools</p>\r\n\r\n<p>&bull; Wedding Menu:<br />\r\n- 2 (two) kind Appetizer Selections<br />\r\n- 1 (one) Soup<br />\r\n- 6 (six) Main Dishes Selections<br />\r\n&nbsp; (Steam Rice, Beef, Chicken, Fish, Vegetable, Noodle)<br />\r\n- 2 (two) kind Dessert Selections<br />\r\n- 3 (three) kind Stall<br />\r\n- 2 (two) kind of Beverages</p>\r\n\r\n<p>&bull; Complimentary 1 (one) room wedding couple at Executive Suite for 1 night<br />\r\n&bull; Complimentary 2 (two) room at Super Deluxe for parents for 1 night<br />\r\n&bull; Flower Arrangement in Bridal Room &amp; Welcome Praline, Bridal Fruit &amp;<br />\r\n&nbsp; &nbsp;Fruit Champagne<br />\r\n&bull; Coffee Break for technical meeting for 10 pax<br />\r\n&bull; Free private venue for make up<br />\r\n&bull; Test food 6(six) person<br />\r\n&bull; Box hantaran (seserahan)<br />\r\n&bull; Reception books</p>\r\n\r\n<p>&bull; Wedding Decoration<br />\r\n- The altar (pelaminan)10x3m<br />\r\n- Gazebo 3x3m<br />\r\n- Mini garden<br />\r\n- Standing Flower<br />\r\n- Coridor Area Reception Guest<br />\r\n- Backdrop VIP<br />\r\n- Backdrop Music<br />\r\n- Set Akad<br />\r\n- Welcome Sign</p>\r\n\r\n<p>&bull; Entertainment Acoustic Band<br />\r\n- 1 Vocal (male / female)<br />\r\n- 1 Keyboard<br />\r\n- 1 Guitar / Saxo<br />\r\n- 1 Bass<br />\r\n- Sound System</p>\r\n\r\n<p>&bull; Wedding Organizer (6 person)<br />\r\n- Book Akad &amp; Resepsi Guide<br />\r\n- Book Wedding Guide<br />\r\n- 6 Crew WO<br />\r\n- 2 Meeting &amp; 1 Technical Meeting</p>\r\n\r\n<p>&bull; MUA &ndash; Make up Artist<br />\r\n&nbsp; (Bridal make up&amp;2 dress for Bridal)<br />\r\n- Make up Akad &amp; Resepsi<br />\r\n- Attire Akad &amp; Resepsi<br />\r\n- Parents Make Up<br />\r\n- Parents Attire<br />\r\n- Siger &amp; M