('585c4ada', 'INTIMATE WEDDING PACKAGE', 'intimate-wedding-package', '<p>&bull; Min. 100 persons</p>\r\n\r\n<p>&bull; Venue at Parahyangan or Poolside<br />\r\n&bull; Police Permit<br />\r\n&bull; Wedding Menu:<br />\r\n- 1 (one) Appetizer Selections<br />\r\n- 1 (one) Soup<br />\r\n- 6 (six) Main Dishes Selection<br />\r\n&nbsp; (Steam Rice, Beef, Chicken,<br />\r\n&nbsp; Vegetable, Noodle)<br />\r\n- 2 (two) Dessert Selections<br />\r\n- 2 (two) complimentary food stall for 30% from number of<br />\r\n&nbsp;guaranteed person</p>\r\n\r\n<p><br />\r\n&bull; Akad nikah at Private Venue for maximum 4 (four) hours&nbsp;<br />\r\n&bull; 1 (one) room wedding couple at Super Deluxe Room for 1 night<br />\r\n&bull; Function Room for Blessing Ceremony<br />\r\n&bull; Free private venue for make up<br />\r\n&bull; Pre-wedding venue for photo or video shooting<br />\r\n&bull; Coffee Break Technical Meeting for 10 pax<br />\r\n&bull; Test food for 6 (six) person<br />\r\n&bull; Electricity capacities up to 5.000 (five thousand) watts<br />\r\n&bull; Reception Books<br />\r\n&bull; Box hantaran (seserahan)<br />\r\n&nbsp;&bull; Special rate for additional room<br />\r\n&nbsp;</p>', 225000, 0, '3', 1, NULL, '2022-08-30 10:04:19'),
('68f1ab1d', 'FULLDAY PACKAGE', 'fullday-package', '2X Coffee Break, 1X Lunch, Meeting Room and Standard Meeting Facilities \r\nInclusive : Infocus, Screen, Mic, Sound, Candy, Note, Pencil, Wifi and Include Tax & Service, 8 Hours usage Meeting Room', 450000, 0, '3', 1, NULL, '2022-03-29 16:20:38'),
('6d604920', 'SWIM & DINE', 'swim-dine', '<p>Buy minimum 110.000 IDR nett (food and beverages) at santan restaurant or sakeca lounge and get free swimming</p>', 110000, 0, '4', 1, NULL, '2022-08-02 10:38:07'),
('75209141', 'HALFDAY MEETING', 'halfday-meeting', '<p>1X Coffee Break, 1X Lunch, Meeting Room and Standard Meeting Facilities Inclusive: Infocus, Screen, Mic, Sound, Candy, Note, Pencil, Wifi and Include Tax &amp; Service, 5 Hours usage Meeting Room</p>', 350000, 0, '3', 1, NULL, '2022-03-29 16:21:18'),
('77542a8d', 'FULLBOARD MEETING', 'fullboard-meeting', '<p>2X Coffee Break, 1X Lunch, 1X Dinner, Meeting Room and Standard Meeting Facilities Inclusive : Infocus, Screen, Mic, Sound, Candy, Note, Pencil, Wifi and Include Tax &amp; Service, 10 Hours usage Meeting Room</p>', 550000, 0, '3', 0, NULL, '2022-03-29 16:23:18'),
('86754410', 'Stay & Relax', 'stay-relax', '<p>Inclusive:</p>\r\n\r\n<ul>\r\n	<li>Stay 1 Night at Deluxe Room</li>\r\n	<li>Breakfast for 2 (Two) person</li>\r\n	<li>Massage for 1 (One) person duration 30 minute</li>\r\n	<li>Access to Fitness Centre | Swimming Pool |</li>\r\n	<li>Sport &amp; Health Centre | Wifi</li>\r\n	<li>Pick Up &amp; Drop Service at Railway Station and Airport</li>\r\n</ul>\r\n\r\n<p>Valid until November 30, 2022</p>', 575000, 0, '4', 1, NULL, '2022-11-07 14:04:15'),
('8c53208d', 'Eleven Best Deal', 'eleven-best-deal', 'Inclusive:\r\nStay 1 Night at Deluxe Room\r\nBreakfast for 1 (One) person\r\nDinner or Laundry for 1 (One) person\r\nAccess to Fitness Centre | Swimming Pool |\r\nSport & Health Centre | Wifi\r\nPick Up & Drop Service at Railway Station and Airport\r\nValid until November 30, 2022', 570000, 0, '4', 1, NULL, '2022-11-07 13:57:35'),
('8d3b2297', 'COFFEE BREAK MEETING', 'coffee-break-meeting', 'Coffee Break  and 2 Hours Usage Meeting Room', 125000, 0, '3', 1, NULL, NULL),
('9abdc5c5', 'RAMADAN DELIGHT', 'ramadan-delight', '<p>BUY 10 GET 1 FREE (every weekday)</p>\r\n\r\n<p>Start from April 5<sup>th</sup>&nbsp;- April 30<sup>th</sup>&nbsp;2022</p>\r\n\r\n<p>Inclusive :</p>\r\n\r\n<ul>\r\n	<li>All You Can Eat Buffet</li>\r\n	<li>Live Cooking &amp; Stall</li>\r\n	<li>Room Voucher, Breakfast Voucher &amp; Swimming Voucher Doorprize (weekly)</li>\r\n	<li>Photobooth</li>\r\n	<li>Hygiene &amp; Standard Protocol Covid-19</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 155000, 0, '4', 0, '2022-03-31 15:28:32', '2022-05-06 14:55:26'),
('a61fd31f', 'Super Saver Deals Package', 'super-saver-deals-package', '<p>STAYCATION PAY 2 NIGHTS GET 3 NIGHTS</p>\r\n\r\n<p>1.299.000 IDR nett/3 nights</p>\r\n\r\n<p>Weekdays Only</p>\r\n\r\n<p>Inclusive:</p>\r\n\r\n<ul>\r\n	<li>Stay 3 Nights at Deluxe Room</li>\r\n	<li>Breakfast for 2 (Two) pax</li>\r\n	<li>Access to Fitness Centre | Swimming Pool | Tennis Court</li>\r\n	<li>Sport &amp; Health Centre | Wifi</li>\r\n	<li>Pick Up &amp; Drop Service at Railway Station and Airport</li>\r\n</ul>\r\n\r\n<p>Valid until October 31, 2022</p>', 1229000, 0, '4', 0, '2022-04-29 15:26:30', '2022-11-07 13:58:57'),
('af680963', 'BANDUNG TOUR PACKAGE', 'bandung-tour-package', '3 DAYS 2 NIGHT\r\n1.750.000 IDR nett/2 persons\r\nInclusive: Upgrade to super deluxe room and breakfast for 2 (two) persons, 1x Lunch voucher at famous local foods , 1x Dinner voucher at hotel or famous local foods, Transportation and city tour to asia afrika/braga, cihampelas & rumah mode & Pick up and drop service airport/train station', 875000, 0, '1', 1, NULL, NULL),
('af7e9452', 'HORISON FIT CLUB MEMBERSHIP', 'horison-fit-club-membership', 'Facilities Gym, Tennis Court, Olimpic Pool, Children Pool, Wave Pool, Changing Room, Fitness, Sauna and Whirlpool\r\n\r\nDiamond     4.000.000 IDR	1 Year\r\nPlatinum     2.400.000 IDR	6 Month\r\nGold	           1.600.000 IDR	3 Month\r\nSilver	       600.000 IDR	1 Month', 600000, 0, '2', 1, NULL, NULL),
('bfa31b4f', 'LUNCH / DINNER', 'lunch-/-dinner', 'Lunch / Dinner and 3 Hours Usage Meeting Room', 150000, 0, '3', 1, NULL, NULL),
('c54d4c13', 'TABLE MANNER', 'table-manner', 'Inclusive :\r\nPrivate Venue |\r\nMinimum 50 pax |\r\nTable Manner Knowledge Presentation |\r\nSet Menu\r\nTour the Hotel |\r\nCertificate Table Manner |\r\nSound System & Microphone |\r\nScreen & LCD Projector |\r\nHygiene & standard Protocol Covid-19', 180000, 0, '3', 1, NULL, NULL),
('c70e5759', 'Delivery Food Package', 'delivery-food-package', '<p>Healthy Bento 40.000 - 45.000/pax *minimum order 5 pax * FREE delivery radius 2 km</p>', 40000, 0, '3', 0, NULL, '2022-11-07 14:07:04'),
('c74a5cdb', 'West Bandung Adventure', 'west-bandung-adventure', 'One day trip exploring the beautiful scenery of West Bandung. Packages including 1 deluxe room, tour guides, transportation from and to the hotel, 1x Lunch, 1x Dinner, and tickets to Sanghiyang Heuleut, Goa Pawon, and Stone Garden.\r\n\r\n\r\n\r\n-Bhara', 1800000, 0, '1', 1, NULL, NULL),
('d62b3bdb', 'Lembang Tour', 'lembang-tour', '2 DAY 1 NIGHT trip to Lembang. You can choose what to visit from our wide variety of choices like The Great Asia Africa, The Lodge Maribaya, Lembang Park, Zoo, Gunung Tangkuban Perahu, Sari Ater Hot Springwater, Lembang Wonderland, Farmhouse Lembang, De’ Ranch Lembang, Orchid Forest Cikole, Floating Market Lembang, Kota Mini Lembang, Lembang Wonderland, Dusun Bambu. This trip includes 1 Deluxe Room, 2x Lunch, 1x Dinner. -Fresh', 1900000, 0, '1', 1, NULL, NULL),
('d7fcd1ea', 'COWORKING SPACE', 'coworking-space', '<p>Inclusive :</p>\r\n\r\n<ul>\r\n	<li>Venue Meeting</li>\r\n	<li>3 Hours usage</li>\r\n	<li>1x tea or coffee</li>\r\n	<li>1x snack - Hygiene &amp; standar protocol Covid-19</li>\r\n	<li>Free wifi access</li>\r\n</ul>', 75000, 0, '4', 1, NULL, '2022-03-31 15:34:40'),
('e644df6c', 'SOCIAL EVENT PACKAGE', 'social-event-package', 'Birthday, Graduation, Table Manner, Arisan Minimum 50 pax  |\r\nInclusive :\r\nPrivate Venue |\r\n1 Super Deluxe Room |\r\nFree Coffee & Tea |\r\nSound System & Microphone |\r\nScreen & LCD Projector |\r\nHygiene & standard Protocol Covid-19', 100000, 1, '3', 1, NULL, NULL),
('e98ab922', 'LET\'S DIVE', 'lets-dive', '<p><strong>Refresh Diving</strong></p>\r\n\r\n<p>Inclusive :</p>\r\n\r\n<ul>\r\n	<li>Ticket Entrance</li>\r\n	<li>Diving Equipment (tanks &amp; weights)</li>\r\n	<li>Meals for 1 pax</li>\r\n	<li>Without instructor</li>\r\n</ul>\r\n\r\n<p><strong>Try Scuba Diving Pool </strong></p>\r\n\r\n<p><strong>1 pax : 475.000</strong></p>\r\n\r\n<p><strong>2 pax : 425.000</strong></p>\r\n\r\n<p><strong>3 pax or more : 375.000</strong></p>\r\n\r\n<p>Inclusive :</p>\r\n\r\n<ul>\r\n	<li>With Instructor</li>\r\n	<li>Ticket Entrance</li>\r\n	<li>Diving Equipment (regulator, BCD, fin &amp; mask)</li>\r\n	<li>Basic Diving Knowledge, Meals for 1 pax &amp; Documentation</li>\r\n	<li>Certificate from Horison Ultima Bandung</li>\r\n</ul>\r\n\r\n<p><strong>Scuba Diving Course</strong></p>\r\n\r\n<p><strong>Start from 5.000.000</strong></p>\r\n\r\n<ul>\r\n	<li>With instructor</li>\r\n	<li>Ticket entrance</li>\r\n	<li>Scuba Diving equipment (regulator, BCD, fin &amp; mask)</li>\r\n	<li>Full Diving Knowledge, Meals for 1 pax &amp; Documentation</li>\r\n	<li>All level scuba diving school by : PADI (Professional Association of Diving Instructor)</li>\r\n</ul>', 250000, 0, '4', 1, NULL, NULL),
('ea7c2ebb', 'HAPPY SWIM LESSONS', 'happy-swim-lessons', '<p>Inclusive :</p>\r\n\r\n<ul>\r\n	<li>Entrance ticket</li>\r\n	<li>1 hour instructor</li>\r\n	<li>Meals and drink</li>\r\n</ul>', 150000, 0, '4', 1, NULL, NULL),
('f5147b01', 'CIWIDEY TOUR PACKAGE', 'ciwidey-tour-package', '3 Days 2 Night\r\n1.960.000 IDR nett/2 persons\r\n\r\nInclusive :\r\nUpgrade to super deluxe room and breakfast for 2 (two) persons, Lunch for 2 (two) persons, Transportation and ticket entrance (situ patenggang/ kawah putih/ pemandian air panas) & Pick up and drop service airport/ train station', 980000, 0, '1', 1, NULL, NULL);
